import React,{Component} from 'react'
import style from 'styled-components'
class Item extends Component{
    constructor(props){
        super(props)
        this.state ={
            course_name : ''
        }
    }
    render(){
        const ItemWrapper = style.div`
        overflow: hidden;
        padding: 5 5 32px;
        margin: 35px auto 0;
        width: 60%;
        height: 125px;
        box-shadow: 0 0 3px rgba(0, 0, 0, .05), 0 0px 12px rgba(0, 0, 0, .08);
        border-radius: 13px;
        `
        const ItemName = style.div`
        text-align: left;
        padding-left: 20px;
        padding-top: 10px;
        font-size: 20px;
        font-weight: bold;
        `

    return(
        <div>
            <ItemWrapper>

                <ItemName>ชื่อหัวข้อเรียน : {this.props.courses_name}</ItemName>

            </ItemWrapper>

        </div>
    );
    } 

}

export default Item;
